import React, { useState, useEffect } from 'react'; 
import axios from 'axios'; 
import 'bootstrap/dist/css/bootstrap.min.css'; 
import { useLocation, useNavigate } from 'react-router-dom'; 

const Logs = () => {   
    const navigate = useNavigate();
    const handleClick = () => {
        navigate('/home'); // Redirige a la página de logs
      };

    return (
        <div>
            <h3>Logs</h3> 
            <button className="btn btn-warning" style = {{ marginLeft: '80%'}}  type="button" onClick={handleClick}>Logs</button>
        </div>
        
      );
};

export default Logs;
